function ImageProcessingModule() {
    dataBase = {};

    class ImageProcessor {
        constructor(data) {
            this.data = data;
        }

        onDone() {
            return this;
        };

        onFilter() {
            return this;
        }

        original() {
            this.setToImage(dataBase.pixelArrayOriginal);
        }

        networkActivate(network) {
            return dataBase.pixelArrayOriginal.map((pixel) => {
                const net = network.activate([pixel[0] / 255, pixel[1] / 255, pixel[2] / 255]);
                net.push(1);
                return net.map((e) => e * 255)
            })
        }

        customFilter(data) {
            this.setToImage(data);
        }

        setToImage(pixelsArray) {
            const prepareArray = [];

            pixelsArray.forEach((e) => {
                prepareArray.push(e[0]);
                prepareArray.push(e[1]);
                prepareArray.push(e[2]);
                prepareArray.push(e[3]);
            });

            prepareArray.forEach((colorBit, i) => {
                dataBase.imageData.data[i] = colorBit;
            });

            dataBase.ctx.putImageData(dataBase.imageData, 0, 0);

            this.onFilter();
        }

        processing() {
            const data = this.data;
            const processor = this;

            return new Promise((done) => {
                (function() {
                    const canvas = document.getElementById(data.id);
                    canvas.width = window.innerWidth;

                    dataBase.canvas = canvas;
                    dataBase.ctx = canvas.getContext('2d');
                })();

                (function () {
                    const image = new Image();
                    const fr = new FileReader();
                    let fileExist = false;

                    fr.onload = function () {
                        image.src = fr.result
                    };

                    data.file.onchange = () => {
                        fileExist = true;
                        processor.processing();
                    };

                    return {
                        listenBtn: (btn) => {
                            btn.addEventListener('click', function () {
                                fileExist && fr.readAsDataURL(file.files[0]);
                            });

                            return new Promise((res) => {
                                image.onload = () => {
                                    res(image);
                                }
                            })
                        }
                    }
                })().listenBtn(data.loadBtn).then((img) => {
                    dataBase.canvas.width = img.width;
                    dataBase.canvas.height = img.height;

                    dataBase.ctx.drawImage(img, 0, 0, dataBase.canvas.width, dataBase.canvas.height);

                    return dataBase.ctx.getImageData(0, 0, dataBase.canvas.width, dataBase.canvas.height);

                }).then((imageData) => {
                    dataBase.imageData = imageData;

                    const pixelArray = [];

                    for(let i = 0; i < imageData.data.length; i+=4) {
                        const segment = [
                            imageData.data[i],
                            imageData.data[i + 1],
                            imageData.data[i + 2],
                            imageData.data[i + 3],
                        ];
                        pixelArray.push(segment);
                    }

                    dataBase.pixelArrayOriginal = pixelArray;

                    this.onDone(pixelArray);

                    done(pixelArray)
                });
            });
        }
    }

    return {
        createProcess: (data) => {
            return new ImageProcessor(data)
        }
    };
}



